Later in this stage (
Fig. 1A
), the squamosal ossifies around the quadrate articulation. The palatine, pterygoid, jugal, and quadratojugal are also ossifying. In the lower jaw, the dentary and supra-angular ossify. The ossification of the jugal is variable, as it is absent in some stage 35 individuals (RM 8021, RM 8053).
